    );
  } else {
    newIncrementAdjustment = silverFeatherIncrement * incrementAdjustment;
  }
  applyIncrementEffect(
    silverCoin,
    incrementAdjustment,
    newIncrementAdjustment,
    silverFeatherIncrement
  );
}

